78–2,000 {{efn|
Will Coster has looked at the figures and states:
|quote|Estimates for the dead at Bolton have ranged from two hundred up to two thousand. Even the lower figure would have made this the worst massacre in the war for loss of life. However the parish register of the town gives the names of only seventy-eight individuals, noting "All those of Botonn slayne on the 28 of May, 1644", which seems to imply that the list is comprehensive. Perhaps more significantly, all three individuals mentioned as murdered in the anonymous parliamentarian eyewitness account published three months later were also named in the register. However, the parish register may exclude defending troops not from the town, who are known to have been present, and those buried elsewhere. The parliamentary account mentions the number of 1,200 or 1,500 murdered. Such a figure is given credence by the fact royalist accounts speak of 1,600 or even two thousand killed. But these versions my have taken their lead from parliamentary propaganda. It is only the seventy-eight named individuates including two women, but at least some soldiers, that can be said with any certainty, to have been killed.|sfn|Coster|1999|pp|=|96–97|}} {{quote|Estimates for the dead at Bolton have ranged from two hundred up to two thousand. Even the lower figure would have made this the worst massacre in the war for loss of life. However the parish register of the town gives the names of only seventy-eight individuals, noting "All those of Botonn slayne on the 28 of May, 1644", which seems to imply that the list is comprehensive. Perhaps more significantly, all three individuals mentioned as murdered in the anonymous parliamentarian eyewitness account published three months later were also named in the register. However, the parish register may exclude defending troops not from the town, who are known to have been present, and those buried elsewhere. The parliamentary account mentions the number of 1,200 or 1,500 murdered. Such a figure is given credence by the fact royalist accounts speak of 1,600 or even two thousand killed. But these versions my have taken their lead from parliamentary propaganda. It is only the seventy-eight named individuates including two women, but at least some soldiers, that can be said with any certainty, to have been killed.|sfn|Coster|1999|pp|=|96–97}} {{sfn|Coster|1999|pp|=|96–97}}

